import React, { useState } from "react";
import WorkerFormLogic from "./WorkerFormLogic";
import WorkerFormDisplay from "./WorkerFormDisplay";

const WorkerForm = () => {
  const [message, setMessage] = useState("");

  // Get the logic and handlers from WorkerFormLogic
  const { formData, handleChange, handleSubmit } = WorkerFormLogic({ setMessage });

  return (
    <WorkerFormDisplay
      formData={formData}
      handleChange={handleChange}
      handleSubmit={handleSubmit}
      message={message}
    />
  );
};

export default WorkerForm;
